export class DataTableColumnBody {
  constructor(_dataParser, styles, newDataLength) {
    this._dataParser = _dataParser;
    this.styles = styles;
    this.newDataLength = newDataLength;
  }
  set dataParser(fnDataParser) {
    this._dataParser = fnDataParser;
  }
  get dataParser() {
    return this._dataParser;
  }
}
